    true,nt"url": null,nt"notes": "Arts Education Surveys of Secondary School
    Teachers, 2009 (FRSS 103), is a study that is part of the Quick Response Information
    System. FRSS 103 (http://nces.ed.gov/surveys/frss/) is a sample survey that provides
    national estimates on arts education and arts instructors in public secondary schools
    during the 2009-10 school year. The study was conducted using mailed questionnaires
    that could be completed via web or by mail. Follow-up telephone interviews were
    also conducted. Teachers were sampled. The study's response rate was 81.8 percent.
    Key statistics produced from FRSS 103 were data on the teaching load of music and
    visual arts specialists in secondary schools; teacher participation in various professional
    development activities and the perceived impact of such participation on teaching;
    and teachersufffd use of formal methods of assessment of studentsufffd progress
